import React,{useState,useEffect} from"react"
import axios from "axios";
import { useParams } from 'react-router-dom';
import { Link } from "react-router-dom";

export default function VehiDe(){

    const{id}=useParams();

    const [vehicle, setVehicles] = useState([]);

    const getVehicle = () => {
        axios.get('http://localhost:6060/Vehicle/get/'+id)
        .then((res) => {
            console.log(res.data);
            setVehicles(res.data.Vehicle);
            
        })
        .catch((err) => {
            alert(err.message);
        });    
        
    };

    useEffect(() => {
        getVehicle();
        
    }, []);


    return(

        <div>
            <div class="search_section">
                <div class="container">
                    <div class="row">
                    <div class="col-md-12">
                        <h1 class="search_taital">mmm... Nice Choice</h1>
                        
                    </div>
                    </div>
                </div>
            </div>

                {vehicle.map((v, index) => (
                    <div class="col-md-4" style={{ marginBottom: "26px" }} key={index}>
                    <div class="gallery_box">
                        <div class="gallery_img">
                        <img src={`http://localhost:6060/images/${v.image}`} alt="Vehicle" />
                        </div>
                        <h3 class="types_text">{v.model}</h3>
                        <p class="looking_text">Start per day: {v.priceperday}</p>
                        {/* Additional details */}
                        <ul class="vehicle_details">
                        <li>Brand: {v.brand}</li>
                        <li>Year: {v.year}</li>
                        <li>Type: {v.type}</li>
                        <li>Fuel Type: {v.fueltype}</li>
                        {/* Include other details similarly */}
                        </ul>
                        <div class="read_bt">
                        <Link to="#">Book Now</Link>
                        </div>
                    </div>
                    </div>
                ))}
        </div>



    )
}
